const soundTry = new Audio(
  "data:audio/wav;base64,"
);

const soundSuccess = new Audio(
  "data:audio/mpeg;base64,"
);

// Set init timer: 6.5s
var time = 3000;
var counter = 0;
// The element that will detect next page the function(number 3 top left screen corner)
var nextPage = document.querySelectorAll(
  ".mat-step-icon.mat-step-icon-state-number"
)[1];

btnClick();

// Changes the timer randomly between (6000ms - 9000ms)
function changeTimer() {
  time = Math.trunc((Math.random() * (9 - 6 + 1) + 6) * 1000);
}

// Function to run at irregular intervals
function btnClick() {
  try {
    // if Next page opened (بيانات صاحب العلاقة)
    if (nextPage.classList.contains("mat-step-icon-selected") === true) {
      console.log("First Steep Done");
      soundSuccess.play();

      try {
        secondPage();
      } catch {
        console.log("slow internet, try again..");
        setTimeout(btnClick, time);
      }
    } else {
      // First Page (بيانات تسليم المعاملة) => (الخطوة التالية)
      document.getElementsByTagName("form")[1].elements[2].click();
      counter++;
      console.log(`${counter} tries`);
      soundTry.play();

      changeTimer();

      setTimeout(btnClick, time);
    }

    // Slow internet! this will let the code try again
  } catch {
    console.log("slow internet, try again..");
    setTimeout(btnClick, time);
  }
}

function secondPage() {
  // Second page (بيانات صاحب العلاقة) => (حفظ ومتابعة)
  document.getElementsByTagName("form")[2].elements[8].click();
  console.log("Second Steep Done");
  soundSuccess.play();

  setTimeout(() => {
    // if Next page opened (صفحة التثبيت)
    if (document.querySelectorAll("button").length === 4) {
      thirdPage();
    } else {
      secondPage();
    }
  }, 2000);
}

function thirdPage() {
  // Third page => (تثبيت)
  document.getElementsByTagName("button")[1].click();
  console.log("Third Steep Done");

  setTimeout(() => {
    try {
      // (نعم)
      document.getElementsByTagName("button")[4].click();

      setTimeout(() => {
        // Payment page
        if (document.querySelectorAll("img").length === 4) {
          soundSuccess.play();
          console.log("ALL Done (نعم)");
        } else {
          thirdPage();
          console.log("try again..");
        }
      }, 2000);
    } catch {
      thirdPage();
      console.log("slow internet, try again..");
    }
  }, 1000);
}
